import React, { useState, useEffect } from "react";

export const AdminAccount = ({ accvalues, selectedId, setSelected }) => {
  const [selectedAccount, setSelectedAccount] = useState(null);
  const [selectedImage, setSelectedImage] = useState(null);
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [dateCreated, setDateCreated] = useState("");
  const [status, setStatus] = useState(true); // true for "Active", false for "Disabled"

  useEffect(() => {
    // Find the selected account by id
    const account = accvalues.find(account => account.id === selectedId);
    if (account) {
      setSelectedAccount(account);
      setUsername(account.username);
      setEmail(account.email);
      setDateCreated(account.date);
      setStatus(account.status === "Active"); // Convert string to boolean
    }
  }, [accvalues, selectedId]);

  const handleImageChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onloadend = () => {
        setSelectedImage(reader.result);
      };
      reader.readAsDataURL(file);
    }
  };

  const handleSave = () => {
    console.log("Save button clicked");
  };

  const handleToggleStatus = () => {
    setStatus(prevStatus => {
      const newStatus = !prevStatus; // Toggle between Active and Disabled
      console.log(newStatus ? "Account Activated" : "Account Disabled");
      return newStatus;
    });
  };

  return (
    <div className="flex items-center justify-center h-screen">
      <div className="max-w-4xl mx-auto bg-white p-8 rounded-lg flex shadow-lg relative flex-col md:flex-row">

        {/* Back Button */}
        <button onClick={() => setSelected("DataTable")} className="absolute top-4 left-4 text-black hover:text-gray-600">
          <i className="fa-solid fa-circle-chevron-left text-3xl"></i>
        </button>

        {/* Image Holder */}
        <div className="w-full md:w-1/2 p-4 flex flex-col items-center">
          <div className="mb-4">
            {selectedImage ? (
              <img src={selectedImage} alt="Selected" className="w-full h-auto rounded-lg mb-4" />
            ) : (
              <div className="border-2 border-gray-300 h-40 flex items-center justify-center mb-4 rounded-lg">
                <span className="text-gray-500">No Image Selected</span>
              </div>
            )}
          </div>
          <input
            type="file"
            accept="image/*"
            onChange={handleImageChange}
            className="mb-4"
          />
        </div>

        {/* Account Details */}
        <div className="w-full md:w-1/2 p-4">
          <h2 className="text-2xl font-bold mb-4">Admin Account Details</h2>
          <input
            type="text"
            value={username}
            placeholder="Username"
            onChange={(e) => setUsername(e.target.value)}
            className="w-full mb-4 p-2 rounded-lg border border-gray-300"
          />
          <input
            type="email"
            value={email}
            placeholder="Email"
            onChange={(e) => setEmail(e.target.value)}
            className="w-full mb-4 p-2 rounded-lg border border-gray-300"
          />
          <input
            type="datetime-local" // Date picker
            value={dateCreated}
            onChange={(e) => setDateCreated(e.target.value)}
            className="w-full mb-4 p-2 rounded-lg border border-gray-300"
          />
          <div className="flex items-center mb-4">
            <span className="mr-2">{status ? "Active" : "Disabled"}</span>
            <button
              onClick={handleToggleStatus}
              className={`py-2 px-4 rounded ${status ? "bg-blue-500" : "bg-red-500"} text-white`}
            >
              {status ? "Deactivate" : "Activate"}
            </button>
          </div>
          <div className="flex justify-between mt-4">
            <button
              onClick={handleSave}
              className="bg-blue-500 hover:bg-blue-700 text-white py-2 px-4 rounded"
            >
              Save
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};
